// m4a to mp3
// https://cloudconvert.com/m4a-to-mp3

// mp3 to data URI
// https://dopiaza.org/tools/datauri/index.php

// var beep = new Audio("data:audio/wav;base64,");  
var timeToGetMoving = new Audio("data:audio/mpeg;base64,");
var alrightBackToWork = new Audio("data:audio/mpeg;base64,");

const delay = ms => new Promise(res => setTimeout(res, ms));

const run = async () => {
    while (true) {
        alrightBackToWork.play();

        var i = 0;
        while (i < 60) {
            console.log(i * 5 + ' seconds elapsed');
            await delay(5000);
            ++i;
        }
        
        timeToGetMoving.play();
        await delay(30000);
    }
};

run();
